import React, { Component } from 'react'

export default class Footers extends Component {
    render() {
        return (
            <div class="f_bg">
                <div>
                    <p>Home</p>
                    <p>About</p>
                    <p>Linkdin</p>
                    <p>Twiteer</p>
                    <p>List</p>
                </div>
            </div>
        )
    }
}
